import React from "react";
import Card from "./Card";
import Data from "../Data";



function App() {
  return (
    <div>
      <Card
      title = {Data[0].title}
      imgURL = {Data[0].imgURL}
      description = {Data[0].description}
      link = {Data[0].link}
      />
      <footer>Made With ❤️ by Victor.Kevz ©2024</footer>
    </div>
  );
}

export default App;
